module.exports = /*#__PURE__*/JSON.parse('{"archive":{"blogPosts":[{"id":"11.0.0","metadata":{"permalink":"/pr-preview/pr-730/release-notes/11.0.0","source":"@site/blog/release-notes/11.0.0.mdx","title":"Release 11.0.0","description":"🚀 Features","date":"2025-08-06T08:42:51.000Z","tags":[{"inline":true,"label":"release-notes","permalink":"/pr-preview/pr-730/release-notes/tags/release-notes"},{"inline":true,"label":"v11","permalink":"/pr-preview/pr-730/release-notes/tags/v-11"},{"inline":true,"label":"breaking-change","permalink":"/pr-preview/pr-730/release-notes/tags/breaking-change"}],"readingTime":0.74,"hasTruncateMarker":true,"authors":[{"name":"Midas","title":"Midas Core Team","url":"https://github.com/migrationsverket/midas","imageURL":"https://avatars.githubusercontent.com/u/110020437?s=200&v=4","key":null,"page":null}],"frontMatter":{"slug":"11.0.0","title":"Release 11.0.0","author":"Midas","author_title":"Midas Core Team","author_url":"https://github.com/migrationsverket/midas","author_image_url":"https://avatars.githubusercontent.com/u/110020437?s=200&v=4","tags":["release-notes","v11","breaking-change"],"pagination_prev":null,"pagination_next":null},"unlisted":false,"nextItem":{"title":"Release 10.4.0","permalink":"/pr-preview/pr-730/release-notes/10.4.0"}},"content":"## 🚀 Features\\n\\n-   **file-upload:** Komponenten `FileUpload` är borttagen och ersatt av `FileTrigger` från React Aria. Detta innebär att API:et för komponenten nu är i linje med React Aria. Se dokumentationen för mer information om hur du använder den nya komponenten.\\n-   **theme:** Nya tokens för `badge-background` har lagts till.\\n\\n## 🩹 Fixes\\n\\n-   **link:** En bugg har fixats som gjorde att länkar med `target=\'_blank\'` inte öppnades i ett nytt fönster.\\n-   **popover:** En bugg har fixats som gjorde att långa strängar kunde flöda över i en popover.\\n-   **theme:** Färger för \\"danger button\\" i dark mode har justerats.\\n\\n## 📖 Documentation changes\\n\\n-   Ett felaktigt `tsx`-exempel har korrigerats.\\n\\n## 🔧 Maintenance\\n\\n-   Beroenden har uppdaterats.\\n\\n## ⚠️ Breaking Changes\\n\\n-   **file-upload:** Komponenten `FileUpload` är borttagen och ersatt av `FileTrigger`. Detta är en \\"breaking change\\" och kräver att du uppdaterar din kod. Se dokumentationen för `file-upload` för mer information.\\n\\n{/* truncate */}\\n\\nSe alla förändringar i detalj på [changelog](/changelog/10.4.0)."},{"id":"/10.4.0","metadata":{"permalink":"/pr-preview/pr-730/release-notes/10.4.0","source":"@site/blog/release-notes/10.4.0.mdx","title":"Release 10.4.0","description":"🚀 Nya funktioner","date":"2025-07-02T00:00:00.000Z","tags":[],"readingTime":1.3,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"Release 10.4.0","date":"2025-07-02T00:00:00.000Z","pagination_prev":null,"pagination_next":null},"unlisted":false,"prevItem":{"title":"Release 11.0.0","permalink":"/pr-preview/pr-730/release-notes/11.0.0"},"nextItem":{"title":"Release 10.3.0","permalink":"/pr-preview/pr-730/release-notes/10.3.0"}},"content":"## 🚀 Nya funktioner\\n\\nTabs exporterar nu samtliga Tab-komponenter från React Aria så att komponenten enklare kan anpassas\\noch stämmer bättre med ursprungligt API,\\n\\n- **tabs:** refactor tabs to support declarative children structure ([#678](https://github.com/migrationsverket/midas/pull/678))\\n\\n## 🩹 Fixar\\n\\nInga hårdkodade strängar för enbart svenska, komponenter går att anpassa efter olika språk. Samtliga komponenter\\naccepterar nu `className` för att applicera egen css.\\n\\n- add translations for all text strings ([#689](https://github.com/migrationsverket/midas/pull/689))\\n- **breadcrumbs:** 💄 accept custom className ([#683](https://github.com/migrationsverket/midas/pull/683))\\n- **calendar:** in range states ([3b7bcd03da](https://github.com/migrationsverket/midas/commit/3b7bcd03da))\\n- **calendar:** change text color token for dates in range ([1656d6d7a1](https://github.com/migrationsverket/midas/commit/1656d6d7a1))\\n- **checkbox:** 💄 accept custom className ([#684](https://github.com/migrationsverket/midas/pull/684))\\n- **checkbox:** add margin-bottom to checkboxgroup-items [run-chromatic] ([0637fd9a5d](https://github.com/migrationsverket/midas/commit/0637fd9a5d))\\n- **color-scheme-switch:** 💄 accept custom className ([#685](https://github.com/migrationsverket/midas/pull/685))\\n- **file-upload:** 💄 accept custom className ([#686](https://github.com/migrationsverket/midas/pull/686))\\n- **layout:** 💄 accept custom className ([#687](https://github.com/migrationsverket/midas/pull/687))\\n- **radio:** 💄 accept custom className ([#688](https://github.com/migrationsverket/midas/pull/688))\\n- **search-field:** 💄 accept custom className ([#690](https://github.com/migrationsverket/midas/pull/690))\\n- **spinner:** 💄 accept custom className ([#691](https://github.com/migrationsverket/midas/pull/691))\\n- **theme:** new tokens for calendar date states ([0f819928d0](https://github.com/migrationsverket/midas/commit/0f819928d0))\\n- **theme:** change dark mode color on calendarBackgroundInRange ([d745cb2adf](https://github.com/migrationsverket/midas/commit/d745cb2adf))\\n- **toast:** 💄 accept custom className ([#692](https://github.com/migrationsverket/midas/pull/692))\\n\\n\\n{/* truncate */}\\n\\nSe alla förändringar i detalj på [changelog](/changelog/10.4.0)."},{"id":"/10.3.0","metadata":{"permalink":"/pr-preview/pr-730/release-notes/10.3.0","source":"@site/blog/release-notes/10.3.0.mdx","title":"Release 10.3.0","description":"Nya funktioner ✨","date":"2025-06-25T00:00:00.000Z","tags":[],"readingTime":0.19,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"Release 10.3.0","date":"2025-06-25T00:00:00.000Z","pagination_prev":null,"pagination_next":null},"unlisted":false,"prevItem":{"title":"Release 10.4.0","permalink":"/pr-preview/pr-730/release-notes/10.4.0"},"nextItem":{"title":"Release 10.2.0","permalink":"/pr-preview/pr-730/release-notes/10.2.0"}},"content":"## Nya funktioner ✨\\n\\n- **Popover:** Ny komponent, se [dokumentation för Popover](/components/popover)\\n\\n## Fixar 💉\\n\\n- **Combobox:** Markerar föregående värde vid musklick\\n- **Storybook:** Felaktiga tillgänglighetsbrister rapporteras inte längre i dark mode\\n\\n{/* truncate */}\\n\\nSe alla förändringar i detalj på [changelog](/changelog/10.3.0)."},{"id":"/10.2.0","metadata":{"permalink":"/pr-preview/pr-730/release-notes/10.2.0","source":"@site/blog/release-notes/10.2.0.mdx","title":"Release 10.2.0","description":"Nya funktioner ✨","date":"2025-06-18T00:00:00.000Z","tags":[],"readingTime":0.89,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"Release 10.2.0","date":"2025-06-18T00:00:00.000Z","pagination_prev":null,"pagination_next":null},"unlisted":false,"prevItem":{"title":"Release 10.3.0","permalink":"/pr-preview/pr-730/release-notes/10.3.0"},"nextItem":{"title":"Release 10.1.1","permalink":"/pr-preview/pr-730/release-notes/10.1.1"}},"content":"## Nya funktioner ✨\\n\\n- **Skeleton:** har en ny prop `isOnLayer01` för användning på alternativ bakgrund.\\n  - Vi påbörjar utfasning av tokens `fieldSkeleton` och `buttonBackgroundSkeleton`, vad god använd `skeleton01` istället.\\n- **Grid:** Grid har ett nytt API med bland annat responsiva brytpunkter, läs mer under [dokumentation för Grid](/components/grid).\\n  - Vi påbörjar utfasning av `fluid`, vad god använd `isContained` istället.\\n  - Vi påbörjar utfasning av `Flex`, vad god använd `Grid` istället.\\n  - Vi påbörjar utfasning av `col` propen för `GridItem`, vad god använd `size` istället.\\n  - Vi påbörjar utfasning av `FlexItem`, vad god använd `GridItem` istället.\\n- **Table:** har en ny prop `size`\\n  - Vi påbörjar utfasning av `narrow`, vad god använd `size` istället.\\n- **Calendar:** har nu stöd för disabled state\\n- **bundle:** Vi delar nu upp vår bundle i mindre \\"chunks\\" för att reducera storleken på appar som använder enstaka Midaskomponenter.\\n\\n## Fixar 💉\\n\\n- **Radio, Calendar** Vi hanterar nu css syntax errors for media queries\\n- **Calendar** Felaktig färg för dag-knapp åtgärdad\\n- **TextField:** Radera `height:100%`\\n\\n## Kosmetika 🎨\\n\\n- **LinkButton:** Byter ut Chevron-ikon till Arrow-ikon\\n- **Table:** Uppdaterar marginaler och utfyllnad\\n\\n{/* truncate */}\\n\\nSe alla förändringar i detalj på [changelog](/changelog/10.2.0)."},{"id":"/10.1.1","metadata":{"permalink":"/pr-preview/pr-730/release-notes/10.1.1","source":"@site/blog/release-notes/10.1.1.mdx","title":"Release 10.1.1","description":"Fixar 💉","date":"2025-06-09T00:00:00.000Z","tags":[],"readingTime":0.32,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"Release 10.1.1","date":"2025-06-09T00:00:00.000Z","pagination_prev":null,"pagination_next":null},"unlisted":false,"prevItem":{"title":"Release 10.2.0","permalink":"/pr-preview/pr-730/release-notes/10.2.0"},"nextItem":{"title":"Release 10.1.0","permalink":"/pr-preview/pr-730/release-notes/10.1.0"}},"content":"## Fixar 💉\\n\\n- Felaktig token som orsakade fel vid hover av `Button` är ersatt.\\n- Prestandaproblem vid stora datamängder i `ComboBox` är åtgärdat.\\n- Tillgänglighetsproblem vid användning av sektioner i `ComboBox` och `Select` är åtgärdat.\\n- Visuell bugg åtgärdad i `DatePicker`.\\n- `Link` visar nu ikoner vid användning av `target=\\"_blank\\"` och `download`\\n- `LinkButton` har nu stöd för `size=\\"medium\\"`.\\n\\n{/* truncate */}\\n\\nSe alla förändringar i detalj på [changelog](/changelog/10.1.1)."},{"id":"/10.1.0","metadata":{"permalink":"/pr-preview/pr-730/release-notes/10.1.0","source":"@site/blog/release-notes/10.1.0.mdx","title":"Release 10.1.0","description":"Nya funktioner ✨","date":"2025-05-23T00:00:00.000Z","tags":[],"readingTime":0.39,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"Release 10.1.0","date":"2025-05-23T00:00:00.000Z","pagination_prev":null,"pagination_next":null},"unlisted":false,"prevItem":{"title":"Release 10.1.1","permalink":"/pr-preview/pr-730/release-notes/10.1.1"},"nextItem":{"title":"Release 10.0.0","permalink":"/pr-preview/pr-730/release-notes/10.0.0"}},"content":"## Nya funktioner ✨\\n\\n- **Accordion** har en ny prop `hasBackground`\\n- **Select** använder `Virtualizer` för förbättrad prestanda när det finns många val. Select tillåter numera\\n  att `id` är `Key` alltså `string | number`. Delvis ny style eftersom select nu använder checkbox från Midas.\\n- **Tag** exporteras som en separat komponent\\n\\n## Fixar 💉\\n\\n- **RadioGroup** tillåter nu bara klick på label, inte utanför.\\n- **Skeleton** tillåter att `className` skrivs över.\\n- **LinkButton** har nu korrekt styles för `isDisabled`.\\n\\n{/* truncate */}\\n\\nSe alla förändringar i detalj på [changelog](/changelog/10.1.0)."},{"id":"/10.0.0","metadata":{"permalink":"/pr-preview/pr-730/release-notes/10.0.0","source":"@site/blog/release-notes/10.0.0.mdx","title":"Release 10.0.0","description":"Nya funktioner","date":"2025-05-15T00:00:00.000Z","tags":[],"readingTime":2.31,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"Release 10.0.0","date":"2025-05-15T00:00:00.000Z","pagination_prev":null,"pagination_next":null},"unlisted":false,"prevItem":{"title":"Release 10.1.0","permalink":"/pr-preview/pr-730/release-notes/10.1.0"},"nextItem":{"title":"Release 9.0.0","permalink":"/pr-preview/pr-730/release-notes/9.0.0"}},"content":"## Nya funktioner\\n\\nI och med version 10.0 introducerar vi en ny storlek på en rad komponenter, `medium`. Komponenter som berörs och\\nnumera kan användas i både `size=\'large\'` och `size=\'medium\'` är:\\n\\n- [Button](/components/button)\\n- [TextField](/components/textfield)\\n- [SearchField](/components/search-field)\\n- [ComboBox](/components/combobox)\\n- [DatePicker](/components/date-picker)\\n- [DateField](/components/datefield)\\n- [Select](/components/select)\\n\\nDefault size är `\'large\'` i samtliga fall. `large` innebär att inputfältet är 48px högt medan `medium` är 40px, för\\nett mer kompakt utseende.\\n\\n{/* truncate */}\\n\\n## Migrera från 9.x.x till 10.0.0\\n\\nEn del funktioner har varit deprecated sen 8.x.x eller tidigare och därför tar Midas tillfället i akt att rensa\\nut gammal kod och överflödiga props/funktioner.\\n\\n:::info\\nKontrollera gärna koden innan uppgradering till version 10.x.x för att säkerställa att ni inte använder\\nnågon funktion eller komponent som numera inte fungerar som väntat.\\n:::\\n\\n### Accordion\\n\\nAccordion har inte längre stöd för prop `type` för att ha flera AccordionItems öppna samtidigt. Använd\\n`allowsMultipleExpanded` istället.\\n\\n```diff\\n- <Accordion type=\'multiple\'>/* items */</Accordion>\\n+ <Accordion allowsMultipleExpanded>/* items */</Accordion>\\n```\\n\\n### Button\\n\\nButton har inte längre stöd för `size=\'small\'`. Däremot introduceras storleken `medium` och det går att välja\\nmellan `\'large\'` och `\'medium\'`, där large är default.\\n\\n```diff\\n//highlight-next-line\\n-   <Button size=\'small\'></Button> // this is no longer valid\\n+   <Button size=\'medium\'></Button>\\n\\n```\\n\\n### Modal, DialogTrigger\\n\\nVarianten med ModalTrigger och Dialog är nu utfasad och istället ska DialogTrigger och Modal användas. En aning\\nförvirrande men principen är liknande och den uppdaterade versionen innehåller många förbättringar.\\nSe dokumentationen för [modal](/components/modal) för hur DialogTrigger används.\\n\\n```diff\\n- import {Dialog, ModalTrigger} from \'@midas-ds/components\' // no longer works\\n+ import {DialogTrigger, Modal} from \'@midas-ds/components\'\\n```\\n\\n### Spinner\\n\\nFrån och med 10.0.0 går det inte längre att använda prop `dark`, använd `ìsOnColor` istället.\\n\\n```diff\\n- <Spinner dark/>\\n+ <Spinner isOnColor/>\\n```\\n\\n### Tabs\\n\\nAnvänd `defaultSelectedKey` istället för `defaultSelected`.\\n\\n```diff\\n- <Tabs defaultSelected={1}> /* tab content */ </Tabs>\\n+ <Tabs defaultSelectedKey={1}> /* tab content */ </Tabs>\\n```\\n\\n### Tokens\\n\\nTokens `borderInvalid` ersätts med `supportBorderWarning` och `textInvalid` ersätts med `textWarning`.\\n\\n```diff\\n- semantic.borderInvalid\\n+ semantic.supportBorderWarning\\n- semantic.textInvalid\\n+ semantic.textWarning\\n\\n```\\n\\nTokens `blue140` (`#25607F`) byter namn till `blue130` samt `blue170` (`#143C50`) byter namn till `blue150`, `purple140`\\nbyter namn till `purple110`.\\n\\n```diff\\n- blue140\\n+ blue130\\n- blue170\\n+ blue150\\n- purple140\\n+ purple110\\n```\\n\\n### useMessageFormatter\\n\\n`useMessageFormatter` försvinner till förmån för `useLocalizedStringFormatter` eftersom den är deprecated hos React Aria.\\n\\n```diff\\n- useMessageFormatter()\\n+ useLocalizedStringFormatter()\\n```\\n\\n### Label\\n\\nLabel variant försvinner i version 10.0.0, det går alltså inte längre att använda `variant=\'label-01\'` eller `label-02`.\\nDefault är numera `label-02` och för att uppnå variant `label-01`, använd komponent `Text` med `slot=\'description\'`.\\n\\n```diff\\n- <Label variant=\'label-01\'>Label</Label>\\n+ <Text slot=\'description\'>Label</Label>\\n```\\n\\n### Skeleton\\n\\nNamnfix på prop `rectangular` som numera heter `rectangle` för en mer konsekvent semantik. Animering är numera endast en\\nboolean, `isAnimated=true|false`.\\n\\n```diff\\n- <Skeleton variant=\'rectangular\' animation=\'wave\'/>\\n+ <Skeleton variant=\'rectangle\' isAnimated />\\n```\\n\\nSe alla förändringar i detalj på [changelog](/changelog/10.0.0)"},{"id":"/9.0.0","metadata":{"permalink":"/pr-preview/pr-730/release-notes/9.0.0","source":"@site/blog/release-notes/9.0.0.mdx","title":"Release 9.0.0","description":"{/ truncate /}","date":"2025-05-08T00:00:00.000Z","tags":[],"readingTime":0.74,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"Release 9.0.0","date":"2025-05-08T00:00:00.000Z","pagination_prev":null,"pagination_next":null},"unlisted":false,"prevItem":{"title":"Release 10.0.0","permalink":"/pr-preview/pr-730/release-notes/10.0.0"},"nextItem":{"title":"Release 8.0.0","permalink":"/pr-preview/pr-730/release-notes/8.0.0"}},"content":"{/* truncate */}\\n\\n## Migrera från 8.x.x till 9.0.0\\n\\n### Card\\n\\nI version 8.3.0 introducerade vi ett nytt och mera modulärt API för `Card`.\\nKomponenten som tidigare accepterade samtliga props är numera en kortyta som måste kompletteras med ett urval från komponenterna `CardContent`, `CardTitle`, `CardActions`, `CardImage`, `CardActionArea` och `CardLink`.\\n\\nFör mer information läs [hur du använder Card](/components/card).\\n\\n### Tokens\\n\\nStrukturen på tokens för `lineHeight` och `size` under `typography` har ändrats.\\nImporterar du dessa värden behöver du justera din kod enligt:\\n\\n#### lineHeight\\n\\n```tsx\\nimport { typography } from \'@midas-ds/components/theme\'\\n```\\n\\n```diff\\n-   typography.lineHeight01\\n+   typography.lineHeight10\\n-   typography.lineHeight02\\n+   typography.lineHeight20\\n-   typography.lineHeight03\\n+   typography.lineHeight30\\n-   typography.lineHeight04\\n+   typography.lineHeight40\\n-   typography.lineHeight05\\n+   typography.lineHeight50\\n-   typography.lineHeight06\\n+   typography.lineHeight60\\n-   typography.lineHeight07\\n+   typography.lineHeight70\\n-   typography.lineHeight08\\n+   typography.lineHeight80\\n-   typography.lineHeight09\\n+   typography.lineHeight90\\n-   typography.lineHeight10\\n+   typography.lineHeight100\\n```\\n\\n#### size\\n\\n```tsx\\nimport { typography } from \'@midas-ds/components/theme\'\\n```\\n\\n```diff\\n\\n-   typography.size01\\n+   typography.fontSize10\\n-   typography.size02\\n+   typography.fontSize20\\n-   typography.size03\\n+   typography.fontSize30\\n-   typography.size04\\n+   typography.fontSize40\\n-   typography.size05\\n+   typography.fontSize50\\n-   typography.size06\\n+   typography.fontSize60\\n-   typography.size07\\n+   typography.fontSize70\\n-   typography.size08\\n+   typography.fontSize80\\n-   typography.size09\\n+   typography.fontSize90\\n-   typography.size10\\n+   typography.fontSize100\\n\\n```\\n\\nSe alla förändringar i detalj på [changelog](/changelog/9.0.0)."},{"id":"/8.0.0","metadata":{"permalink":"/pr-preview/pr-730/release-notes/8.0.0","source":"@site/blog/release-notes/8.0.0.mdx","title":"Release 8.0.0","description":"I version 8.3.0 introducerar vi breaking changes för Card som var tänkta för version 9. Vänligen läs release notes för version 9 för mer information.","date":"2025-04-15T00:00:00.000Z","tags":[],"readingTime":0.65,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"Release 8.0.0","date":"2025-04-15T00:00:00.000Z","pagination_prev":null,"pagination_next":null},"unlisted":false,"prevItem":{"title":"Release 9.0.0","permalink":"/pr-preview/pr-730/release-notes/9.0.0"},"nextItem":{"title":"Release 7.0.0","permalink":"/pr-preview/pr-730/release-notes/7.0.0"}},"content":":::warning\\nI version 8.3.0 introducerar vi breaking changes för `Card` som var tänkta för version 9. Vänligen läs release notes för [version 9](/release-notes/9.0.0) för mer information.\\n:::\\n\\n{/* truncate */}\\n\\n## Migrera från 7.x.x till 8.0.0\\n\\n### Select\\n\\nVärdet i callbacken `onSelectionChange` för komponenten `Select` har ändrats.\\nNumera skickas valda nycklar med en `Selection` type (`\\"all\\" | Set<string | number>`) när användaren justerar sitt val.\\n\\n```diff\\n-   onSelectionChange?: ((value: Selection | Key | Key[]) => void) | undefined\\n+   onSelectionChange?: ((keys: Selection) => void) | undefined\\n```\\n\\nDetta innebär att du behöver hantera om användaren klickar på \\"Välj alla\\" manuellt:\\n\\n```tsx\\nconst handleSelectionChange = (keys: Selection) => {\\n  if (keys === \'all\') {\\n    return setSelection(new Set(options.map(({ id }) => id)))\\n  }\\n  return setSelection(keys)\\n}\\n```\\n\\nFör mer information, läs [instruktioner för `Select` och kontrollerade val](/components/select/#kontrollerade-val)\\n\\nSe alla förändringar i detalj på [changelog](/changelog/8.0.0)."},{"id":"/7.0.0","metadata":{"permalink":"/pr-preview/pr-730/release-notes/7.0.0","source":"@site/blog/release-notes/7.0.0.mdx","title":"Release 7.0.0","description":"{/ truncate /}","date":"2025-04-02T00:00:00.000Z","tags":[],"readingTime":0.36,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"Release 7.0.0","date":"2025-04-02T00:00:00.000Z","pagination_prev":null,"pagination_next":null},"unlisted":false,"prevItem":{"title":"Release 8.0.0","permalink":"/pr-preview/pr-730/release-notes/8.0.0"},"nextItem":{"title":"Release 6.0.0","permalink":"/pr-preview/pr-730/release-notes/6.0.0"}},"content":"{/* truncate */}\\n\\n## Migrera från 6.x.x till 7.0.0\\n\\n`TextField` stödjer inte längre `validationType`.\\n\\n### pattern\\n\\nOm du vill använda HTML native constraint validation, använd egenskapen `pattern`.\\nLäs mer om [pattern på MDN](https://developer.mozilla.org/en-US/docs/Web/HTML/Reference/Elements/input#pattern)\\n\\n### validate\\n\\nFör anpassad validering med tillhörande felmeddelande, använd `validate`.\\nLäs mer om egenskapen under vår [dokumentation för TextField](/components/textfield/#egen-validering)\\n\\nSe alla förändringar i detalj på [changelog](/changelog/7.0.0)."},{"id":"/6.0.0","metadata":{"permalink":"/pr-preview/pr-730/release-notes/6.0.0","source":"@site/blog/release-notes/6.0.0.mdx","title":"Release 6.0.0","description":"- Vi påbörjar utfasning av Dialog, vänligen använd Modal istället.","date":"2025-03-24T00:00:00.000Z","tags":[],"readingTime":0.14,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"Release 6.0.0","date":"2025-03-24T00:00:00.000Z","pagination_prev":null,"pagination_next":null},"unlisted":false,"prevItem":{"title":"Release 7.0.0","permalink":"/pr-preview/pr-730/release-notes/7.0.0"},"nextItem":{"title":"Release 5.0.0","permalink":"/pr-preview/pr-730/release-notes/5.0.0"}},"content":"- Vi påbörjar utfasning av `Dialog`, vänligen använd `Modal` istället.\\n- Vi påbörjar utfasning av `ModalTrigger`, vänligen använd `DialogTrigger` istället.\\n\\n{/* truncate */}\\n\\nSe alla förändringar i detalj på [changelog](/changelog/6.0.0)."},{"id":"/5.0.0","metadata":{"permalink":"/pr-preview/pr-730/release-notes/5.0.0","source":"@site/blog/release-notes/5.0.0.mdx","title":"Release 5.0.0","description":"Vi introducerar stöd för dark mode på samtliga komponenter","date":"2025-03-17T00:00:00.000Z","tags":[],"readingTime":0.1,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"Release 5.0.0","date":"2025-03-17T00:00:00.000Z","pagination_prev":null,"pagination_next":null},"unlisted":false,"prevItem":{"title":"Release 6.0.0","permalink":"/pr-preview/pr-730/release-notes/6.0.0"},"nextItem":{"title":"Release 4.0.0","permalink":"/pr-preview/pr-730/release-notes/4.0.0"}},"content":"Vi introducerar stöd för dark mode på samtliga komponenter\\n\\n{/* truncate */}\\n\\nSe alla förändringar i detalj på [changelog](/changelog/5.0.0)."},{"id":"/4.0.0","metadata":{"permalink":"/pr-preview/pr-730/release-notes/4.0.0","source":"@site/blog/release-notes/4.0.0.mdx","title":"Release 4.0.0","description":"{/ truncate /}","date":"2025-03-10T00:00:00.000Z","tags":[],"readingTime":0.21,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"Release 4.0.0","date":"2025-03-10T00:00:00.000Z","pagination_prev":null,"pagination_next":null},"unlisted":false,"prevItem":{"title":"Release 5.0.0","permalink":"/pr-preview/pr-730/release-notes/5.0.0"},"nextItem":{"title":"Release 3.0.0","permalink":"/pr-preview/pr-730/release-notes/3.0.0"}},"content":"{/* truncate */}\\n\\n## Migrera från 3.x.x till 4.0.0\\n\\n### Select\\n\\n`MultiSelect` ersätts av `Select`, vänligen använd `selectionMode` för en flerväljare:\\n\\n```tsx\\n<Select selectionMode=\'multiple\' />\\n```\\n\\nSe mer information om [hur du använder Select](/components/select)\\n\\nSe alla förändringar i detalj på [changelog](/changelog/4.0.0)."},{"id":"/3.0.0","metadata":{"permalink":"/pr-preview/pr-730/release-notes/3.0.0","source":"@site/blog/release-notes/3.0.0.mdx","title":"Release 3.0.0","description":"{/ truncate /}","date":"2025-02-28T00:00:00.000Z","tags":[],"readingTime":0.26,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"Release 3.0.0","date":"2025-02-28T00:00:00.000Z","pagination_prev":null,"pagination_next":null},"unlisted":false,"prevItem":{"title":"Release 4.0.0","permalink":"/pr-preview/pr-730/release-notes/4.0.0"},"nextItem":{"title":"Release 2.0.0","permalink":"/pr-preview/pr-730/release-notes/2.0.0"}},"content":"{/* truncate */}\\n\\n## Migrera från 2.x.x till 3.0.0\\n\\n### SearchField\\n\\n`SearchField` stödjer inte längre `isRequired`. Beteendet kan efterliknas med hjälp av `validate`\\n\\n```tsx\\n<SearchField validate={v => !!v.length || \'Var god ange åtminstone ett tecken\' />\\n```\\n\\nSe mer information om [hur du använder SearchField](/components/search-field)\\n\\nSe alla förändringar i detalj på [changelog](/changelog/3.0.0)."},{"id":"/2.0.0","metadata":{"permalink":"/pr-preview/pr-730/release-notes/2.0.0","source":"@site/blog/release-notes/2.0.0.mdx","title":"Release 2.0.0","description":"{/ truncate /}","date":"2025-02-25T00:00:00.000Z","tags":[],"readingTime":0.13,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"Release 2.0.0","date":"2025-02-25T00:00:00.000Z","pagination_prev":null,"pagination_next":null},"unlisted":false,"prevItem":{"title":"Release 3.0.0","permalink":"/pr-preview/pr-730/release-notes/3.0.0"}},"content":"{/* truncate */}\\n\\n## Migrera från 1.x.x till 2.0.0\\n\\n### TextField, TextArea\\n\\n`maxCharacters` byter namn till `maxLength` för enhetlighet\\n\\nSe alla förändringar i detalj på [changelog](/changelog/2.0.0)."}]}}');

